import React from "react";
import Thumnail from './video-thumbnail';
import Video1 from '../images/video1.jpg';

export function ThumbContainer() {
  return (<div className="thumb-container">
    <Thumnail image={Video1} />
    <Thumnail />
    <Thumnail />
    <Thumnail />
    <Thumnail />
    <Thumnail />
    <Thumnail />
    <Thumnail />
  </div>);
}
